import { Text, FlatList, StyleSheet} from "react-native";
import React from "react";

const FlatListDemo = () => {
  const names = [
    {
      index: "1",
      name: "Ruby"
    },
    {
      index: "2",
      name: "Jain"
    },
    {
      index: "3",
      name: "Kriti"
    },
    {
      index: "4",
      name: "Sanon"
    },
  ];

  return (
    <FlatList
      keyExtractor={(key) => {
        return key.index;
      }}
      data={names}
      renderItem={({ item }) => {
        console.log(item.name);
        return <Text style={styles.txt}>{element.item.name}</Text>;
      }}
    />
  );
};
const styles = StyleSheet.create({
  txt: {
    fontWeight: "bold",
    fontSize: 30,
  },
});

export default FlatListDemo;
